import React, { Component } from 'react';
import logo from './zenika.svg';
import './App.css';

class App extends Component {
  handleClick = () =>{
    return(<p>Go !</p>)
  }

  render() {
    return (
      <div className="App">
        <header className="App-header" onClick = {(screen) => this.handleClick()}>
          <img src={logo} className="App-logo" alt="logo" />
          <p>Welcome to the ZenBeer Brewing Assistant !</p>
          if(screen){
            {screen}
          }else{
            <h1>Ready ?</h1>
          }
        </header>
      </div>
    );
  }
}

export default App;
